#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
	{ 
	  # Film
	  ns:m.0534r8 ns:film.film_character.portrayed_in_films ?y .
	  ?y ns:film.performance.actor ?x .
	  ?y ns:film.performance.special_performance_type ns:m.02nsjvf . #voice
	}
	UNION
	{
	  # TV
	  ns:m.0534r8 ns:tv.tv_character.appeared_in_tv_program ?y .
	  ?y ns:tv.regular_tv_appearance.actor ?x .
	}?x ns:people.person.profession ns:m.018gz8 . 
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x 
WHERE {
	FILTER (?x != ns:m.01znc_)
	{ 
	  ns:m.01znc_ ns:location.statistical_region.places_exported_to ?y .
	  ?y ns:location.imports_and_exports.exported_to ?x . 
	}
	UNION
	{
	  ns:m.01znc_ ns:location.statistical_region.places_imported_from ?y .
	  ?y ns:location.imports_and_exports.imported_from ?x . 
	}?x ns:location.statistical_region.places_exported_to ?c .
?c ns:location.imports_and_exports.exported_to ns:m.035qy . 
}
